<div className="container">
      <h1>Al Events</h1>
      <p>List of events triggered by cameras</p>
      <div className="header">
        <div className="dropdown">
          <button className="dropdown-button">All Device</button>
          {/* Add dropdown options here */}
        </div>
        <button className="header-button">Events</button>
        <button className="header-button">Notifications</button>
        <button className="header-button">Reports</button>
      </div>
      <div className="nav">
        <button className="nav-button">previous week</button>
        <button className="nav-button">next week</button>
      </div>
      <div className="dates">
        {dates.map((date) => (
          <div
            key={date.date}
            className={`date-button ${selectedDate === date.date ? 'selected' : ''}`}
            onClick={() => handleDateClick(date.date)}
          >
            <p>{date.date}</p>
            <p>{date.day}</p>
          </div>
        ))}
      </div>
      <div className="models">
        <div className="models-header">
          <input
            type="text"
            placeholder="All detection models"
            className="models-input"
            readOnly
          />
          <button className="models-clear">clear</button>
        </div>
        <div className="models-list">
          {models.map((model) => (
            <div
              key={model.name}
              className={`model-item ${selectedModel === model.name ? 'selected' : ''}`}
              onClick={() => handleModelClick(model.name)}
            >
              <p>{model.name}</p>
              {selectedModel === model.name && <div className="check-mark"></div>}
            </div>
          ))}
        </div>
      </div>
      <div className="preview">
        {/* Add preview content here */}
      </div>
    </div>
    </>
  );
}

export default App;
